css:
/*Tarja Informações*/
.info-bar {
    background: #ffffff;
    color: #000;
    margin-left: auto;
    margin-right: auto;
    max-width: var(--content-max-width);
    width: 100%;
}

/*Tamanho FAQ*/
.pt-1, .py-1 {
    padding-top: 0rem;
}

/*manutenção página*/
.footer__social {
    font-size: var(--font-size-lg);
}

#manutencao-da-loja .container {
    display: flex !important;
    flex-direction: column;
    justify-content: center !important;
    align-items: center !important;
    text-align: center;
    font-size: 200%;
   }
#manutencao-da-loja .container img {
    padding-bottom: 50px;
    width: auto;
    max-width: 450px;
}

.__pages_manutencao .header,
.__pages_manutencao .footer {
    display: none !important;
}

@media screen and (max-width: 480px) {
    #manutencao-da-loja .container img {
        padding-bottom: 50px;
        max-width: 100% !important;
    }
}
